export const showContent = keyframes`
    0% {
        opacity: 0;
    }
    70% {
        opacity: 0;
    }
    100% {
        opacity: 1;
    }
`

export const shartShowContent = keyframes`
    0% {
        opacity: 0;
        transform: scale(0);
    }
    100% {
        opacity: 1;
        transform: scale(1);
    }
`

export const showHards = keyframes`
    0% {
        opacity: 0;
        transform: scale(1);
    }
    50% {
        opacity: 1;
        transform: scale(1.01);
    }
    100% {
        opacity: 1;
        transform: scale(1);
    }
`

export const circleAnimate = keyframes`
    0% {
        stroke-dasharray: 1200 0;
        stroke-dashoffset: 1450;
    }
    33% {
        stroke-dasharray: 850 350;
        stroke-dashoffset: 1180;
    }
    66% {
        stroke-dasharray: 350 850;
        stroke-dashoffset: 700;
    }
    100% {
        stroke-dasharray: 0 1200;
        stroke-dashoffset: 300;
    }
`

export const circleDashedAnimation = (to, from) => keyframes`
    0% {
        stroke-dasharray: 475 0;
        stroke-dashoffset: ${to};
    }
    100% {
        stroke-dasharray: 0 475;
        stroke-dashoffset: ${from};
    }
`

